function PostForm(n,t){$.ajax({dataType:"JSON",type:"POST",url:n.attr("action"),data:n.serialize(),success:function(n){switch(n){case!0:t(n);break;case!1:t(n);break;case null:alert("Model invalid")}},error:function(n,t,i){return alert(i),!1}})}function Post(n,t){$.ajax({dataType:"JSON",type:"POST",url:n,data:JSON.stringify(t),success:function(n){switch(n){case!0:alert("Succes");break;case!1:alert("Failed")}}})}